import React from "react";
import Form from "react-bootstrap/Form";

export class Popup extends React.Component {
  render() {
    return (
      <div>
        <h1>Upload a Video</h1>
        <Form>
          <Form.Control
            type="title"
            placeholder="Title your video"
            className="me-2"
            aria-label="Title"
          />
          <Form.Control
            type="search"
            placeholder="Search"
            className="me-2"
            aria-label="Search"
          />
        </Form>
      </div>
    );
  }
}
